import {get, del, post, put} from "./HttpService";
import endpoints from "../config/endpoints";


export default class PropertiesService {
  static searchProperties(dataSearch = {nextToken: "", limit: 10}, type = null) {
    return get(endpoints.propetiesManagement.list + (type ? `?type=${type}` : "?all=true"), dataSearch).then(value => {
      return value ? value.data : null;
    });
  }

  static removeProperties(id) {
    return del(endpoints.propetiesManagement.delete.replace(":ID", id)).then(value => {
      return value ? value.data : null;
    });
  }

  static updateProperties(id, properties) {
    return put(endpoints.propetiesManagement.update.replace(":ID", id), properties).then(value => {
      return value ? value.data : null;
    });
  }

  static createProperties(properties, type = null) {
    if (!properties.descriptions) {
      delete properties.descriptions;
    }
    properties.type = type;
    return post(endpoints.propetiesManagement.create, properties).then(value => {
      return value ? value.data : null;
    });
  }
}
